ConstValues.value:
"query GetGidocument($id: Int, $filter: String) {
  getGidocument(id: $id) {
    __typename
    id
    giid
    company {
      __typename
      ... on object_Company {
        __typename
        companyname
        companylogo {
          __typename
          ... on asset {
            __typename
            fullpath
            thumb: fullpath(thumbnail: "companyBrand")
          }
        }
      }
    }
    giname
    pdffile {
      __typename
      ... on asset {
        __typename
        fullpath
      }
    }
    timeliness
    pisstatus
    pisversion
    timelinessold
    changedchapters {
      __typename
      id
      title
    }
    companyname
    ingredients {
      __typename
      ... on fieldcollection_ingredient {
        __typename
        ingredientname
      }
    }
    packages {
      __typename
      ... on fieldcollection_package {
        __typename
        pzn
        gtin
        packagename
      }
    }
    headline
    headertexttop
    useradvicetitle
    useradvicecontent
    toctitle
    tocentry {
      __typename
      ... on fieldcollection_tocentry {
        __typename
        tocentrynumber
        tocentrytext
      }
    }
    headertextbottom
    indicationstitle
    indicationscontent
    precautionstitle
    precautionscontent
    applicationtitle
    applicationcontent
    adversereactionstitle
    adversereactionscontent
    storagetitle
    storagecontent
    additionalinfotitle
    additionalinfocontent
    additionalsections {
      __typename
      ... on fieldcollection_section {
        __typename
        sectionnumber
        sectiontitle
        sectioncontent
      }
    }
  }
  getAdditionalMaterialListing(filter: $filter) {
    __typename
    edges {
      __typename
      node {
        __typename
        chapterKey
        material {
          __typename
          ... on block_AdditionalMaterial_material_entry {
            __typename
            label
            url {
              __typename
              text
            }
            url {
              __typename
              path
            }
          }
        }
      }
    }
  }
}"
